import React from 'react';
import styles from './users.module.css';

let Users=(props)=>{
    return props.users.users.map((i)=>{
        return (
            <div key={i.id}>
                <span>
                    <div>
                        <img src={i.photoUrl} className={styles.userPhoto}/>
                    </div>
                    <div>
                        {i.followed
                            ? <button onClick={()=>{props.unfollow(i.id)}}>Unfollow</button>
                            : <button onClick={()=>{props.follow(i.id)}}>Follow</button>}

                    </div>
                </span>
                <span>
                    <span>
                        <div>{i.fullName}</div>
                        <div>{i.status}</div>
                    </span>
                    <span>
                        <div>{i.location.country}</div>
                        <div>{i.location.city}</div>
                    </span>
                </span>
            </div>
        )
    })
    return (
        <div>
            {userItems}
        </div>
    )
}

export default Users;
